import React, { Component } from 'react';
import { Link } from 'react-router-dom';

 class List extends Component {
  render() {
    return (
      <div className="contact">
        <h1>Liste</h1>
        <Link to={'./lister1'}>
        <button variant="raised">
            My List
        </button>
      </Link>
      </div>
    )
  }
}

export default List;
